void doInference(IExecutionContext &context, float* input, int data_offset, int batch_size, int width,
	char*  input_layer, char*  output_layer, int num_class, int * out_label, float * out_score , int label_offset)
{
	const ICudaEngine& engine = context.getEngine();
	// input and output buffer pointers that we pass to the engine - the engine requires exactly IEngine::getNbBindings(),
	// of these, but in this case we know that there is exactly one input and one output.
	assert(engine.getNbBindings() == 2);
	void* buffers[2];

	// In order to bind the buffers, we need to know the names of the input and output tensors.
	// note that indices are guaranteed to be less than IEngine::getNbBindings()
	int inputIndex = engine.getBindingIndex(output_layer);
	int outputIndex = engine.getBindingIndex(output_layer);

	std::unique_ptr<float[]> output(new float[batch_size * num_class * sizeof(float)]);

	// create GPU buffers and a stream
	CHECK(cudaMalloc(&buffers[inputIndex], batch_size * 1 * width * sizeof(float)));
	CHECK(cudaMalloc(&buffers[outputIndex], batch_size * num_class * sizeof(float)));

	cudaStream_t stream;
	CHECK(cudaStreamCreate(&stream));

	printf("==11111  len: %d\n", batch_size * 1 * width * sizeof(float) );

	// DMA the input to the GPU,  execute the batch asynchronously, and DMA it back:
	CHECK(cudaMemcpyAsync(buffers[inputIndex], input + data_offset , batch_size * 1 * width * sizeof(float), cudaMemcpyHostToDevice, stream));

	printf("-----11111\n");
	context.enqueue(batch_size, buffers, stream, nullptr);
	printf("-----22222\n");

	CHECK(cudaMemcpyAsync(output.get(), buffers[outputIndex], batch_size * num_class * sizeof(float), cudaMemcpyDeviceToHost, stream));
	cudaStreamSynchronize(stream);

	printf("==2222\n");
	// release the stream and the buffers
	cudaStreamDestroy(stream);
	CHECK(cudaFree(buffers[inputIndex]));
	CHECK(cudaFree(buffers[outputIndex]));

	printf("==33333\n");

	//根据输出确定label和score
	float * out_buf = output.get();
	for (int sample_ind = 0; sample_ind < batch_size; sample_ind++)
	{
		float score{ 0.0f };
		int label_idx{ 0 };
		for (unsigned int i = 0; i < num_class; i++)
		{
			float cur_score = out_buf[sample_ind*num_class + i];
			score = std::max(score, cur_score);
			if (score == cur_score) label_idx = i;
		}

		out_label[label_offset + sample_ind] = label_idx;
		out_score[label_offset + sample_ind] = score;
	}

}


int loadGraphWithLicenceAndPbname(char* pbname_c, char* pbBuf, int pbLen, char* licenceData, int licenceLen, float per_process_gpu_memory_fraction) {
	std::string pbname(pbname_c);
	if (pbname2sessionptr.count(pbname) > 0)
	{
		printf("exist this pbname\n");
		return 0;
	}


	char clientSN[100];
	memset(clientSN, 0, 100);
	getPartData(licenceData, ':', 0, clientSN);

	char pdType[20];
	memset(pdType, 0, 20);
	getPartData(licenceData, ':', 1, pdType);

	char bpFileLen[20];
	memset(bpFileLen, 0, 20);
	getPartData(licenceData, ':', 2, bpFileLen);
	char base64CipherPbKey[100];
	memset(base64CipherPbKey, 0, 100);
	getPartData(licenceData, ':', 3, base64CipherPbKey);

	//printf(">>>>>>>>>>>%s,,%s,,%s\n",clientSN,bpFileLen,base64CipherPbKey);

	int cipherPbKeyLen = 0;
	unsigned char* cipherPbKey = decodeBase64(base64CipherPbKey, strlen(base64CipherPbKey), &cipherPbKeyLen);

	char seedKeyHex[] = "8874e9f4a5eec793873c56b158fdf393";
	char seedKey[16];
	hex2ByteArray(seedKeyHex, (unsigned char*)seedKey, 16);

	//printf("bpFileLen1:%s,cipherPbKeyLen:%d\n", bpFileLen,cipherPbKeyLen);

	unsigned char pbKey[1024];
	decryptPbKey(cipherPbKey, cipherPbKeyLen, clientSN, seedKey, pbKey);

	//printf("bpFileLen2:%s,pbLen:%d\n", bpFileLen,pbLen);
	free(cipherPbKey);

	//printf("%s\n", out_str);

	unsigned char* def_data = new unsigned char[pbLen];
	decryptPbData((unsigned char*)pbBuf, pbLen, pbKey, def_data);

	int realLen = atoi(bpFileLen);

	//printf(">>>%s to %d\n", bpFileLen,realLen);

	IRuntime* runtime = nvinfer1::createInferRuntime(logger);
	ICudaEngine* engine = runtime->deserializeCudaEngine(def_data, pbLen , nullptr);
	pbname2sessionptr[pbname] = engine;

	printf("loading ExecutionContext finished\n");
	return 1;
}

void do_classify_with_pbname(char* pbname_c, float * data, int sample_num, int width, int batch_size, int * out_label, float * out_score, int num_class, char* input_layer_c, char* output_layer_c) {
	// First we load and initialize the model.
	std::string pbname(pbname_c);
	if (pbname2sessionptr.count(pbname) == 0) {
		printf("tensorflow session not init");
		return;
	}
	ICudaEngine* engine = pbname2sessionptr[pbname];
	IExecutionContext *context = engine->createExecutionContext();

	int count = sample_num / batch_size;
	int data_offset = 0;
	int label_offset = 0;
	for (int i = 0; i < count; i++)
	{
		data_offset = i *batch_size*width;
		label_offset = i * batch_size;

		doInference(*context, data, data_offset, batch_size, width, input_layer_c, output_layer_c, num_class, out_label, out_score, label_offset);
	}

	if (sample_num % batch_size > 0)
	{
		data_offset = count *batch_size*width;
		label_offset = count * batch_size;

		doInference(*context, data, data_offset, sample_num % batch_size, width, input_layer_c, output_layer_c, num_class, out_label, out_score, label_offset);

	}

	context->destroy();
}

void unloadGraph_with_pbname(char * pbname_c)
{
	std::string pbname(pbname_c);
	if (pbname2sessionptr.count(pbname) >0) {
		ICudaEngine* engine = pbname2sessionptr[pbname];
		engine->destroy();
		pbname2sessionptr.erase(pbname);
	}
}


